   <div className="dbg m1" style={{ marginLeft: "0px", width: "35px", padding: ".2% 1px" }}></div>
   <div className="row flexAIC"><img src="http://www.w3.org/2000/svg" alt="" /></div><p className="heading clr">Rated 'Leader' on G2.</p>
